import './Category.css'
import { Reorder } from "framer-motion"
import { useState } from "react"

const Product = () => {
    const [items, setItems] = useState([0, 1, 2, 3])

    return (
    <div className="Main Product">
        <AnimatePresence>
  {items.map(item => (
    <Reorder.Item
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      exit={{ opacity: 0 }}
      key={item}
    />  
  ))}
</AnimatePresence>
    </div>
    );
}
 
export default Product;
